import React from 'react';
import './Navbar.css';

const Navbar = () => {
  return (
    <div>
        
        <div className='navbar-container'>
          <div className='navbar-content'>
            
             <ul className='navul'>

                <h1 id="n-logo">ArtFusion</h1>
                <li className='navmenu' href="#">Who we are?</li>
                <li className='navmenu' href="#">Why us?</li>
                <li className='navmenu' href="#">Marketplace</li>

                <button className='nav-button'>Login</button>

             </ul>
          </div>
        </div>

    </div>
  )
}

export default Navbar
